import React from 'react';

function Education() {
  return (
    <div>
      <h3>Education</h3>
      <ul className="bulleted-list">
        <li style={{ listStyleType: 'disc' }}>
          <strong>Ajou University (아주대학교) | 2020.03 - 2024.03</strong>
          <ul className="bulleted-list">
            <li style={{ listStyleType: 'circle' }}><strong>Early Graduation (조기 졸업)</strong></li>
          </ul>
          <ul className="bulleted-list">
            <li style={{ listStyleType: 'circle' }}><strong>GPA</strong> | 4.20 / 4.50</li>
          </ul>
        </li>
      </ul>
    </div>
  );
}

export default Education;
